// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import BerichtenPagina from "./Berichten/berichten";
import ChatPage from "./Berichten/bericht.js";
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<BerichtenPagina />} />
        <Route path="/berichten/:messageId" element={<ChatPage />} /> {/* Dynamic route for individual chats */}
      </Routes>
    </Router>
  );
}

export default App;
